import React, {Components} from 'react';
import './App.css';
import {Route} from 'react-router-dom';
import { render } from '@testing-library/react';

class App extends Components {
  render(){
    return (
      <div className="App">
        <Route path='/users' />
      </div>
    );
  }
}

export default App;
